「肌研 極潤 パーフェクトUVジェル ピンクベージュ SPF50+ PA++++ 50g」は、1つで5役(日やけ止め、化粧水、乳液、美容液、化粧下地)、3種のうるおい成分配合のUV保湿ジェルです。すーっと軽くなじむみずみずしいジェルが肌にうるおいを届けます。乾燥から肌を守る3つのヒアルロン酸配合。くすみを補正し、ひとぬりでぱっと明るくなるピンクベージュです。無香料・鉱物油フリー・パッチテスト済み(すべての方に刺激が起こらないというわけではありません)。SPF50+、PA++++。(R)肌研、(R)ハラダボ、(R)極潤<br><br>使用方法<br><br>○必ず少量ずつ手のひらにとり、肌にムラなくのばしてください。<br>○効果を保つため、こまめにぬりなおしてください特に、汗をぬぐうことが多い場合(海、山、スポーツ時など)は、汗をかいた後やタオルで拭いた後などにも、こまめにぬりなおしてください。<br>○落とすときは、洗顔料でていねいに洗い流してください。<br><br>ご注意<br><br>○傷、はれもの、湿疹、かぶれ等、異常がある時は使用しないでください。<br>○肌に異常が生じていないかよく注意してご使用ください。使用中、又は使用後日光にあたって、赤み、はれ、かゆみ、刺激、色抜け(白班等)や黒ずみ等の異常があらわれた時は使用を中止し、皮フ科専門医等へご相談ください。そのまま使用を続けますと症状が悪化することがあります。<br>○目に入らないようにご注意ください。万一目に入った場合は、すぐに水又はぬるま湯で洗い流してください。なお、異常が残る場合は眼科医にご相談ください。<br>○乳幼児の手の届かない所に保管してください。<br>○高温又は低温の場所、直射日光を避け、密栓して保管してください。<br>○材質によっては落ちにくいことがありますので、衣服等につかないよう十分ご注意ください。万一、衣服についた場合はすぐに洗剤でていねいに洗ってください。また、変色(着色)する場合がありますので、塩素系漂白剤のご使用は避けてください。<br><br>成分<br><br>水、メトキシケイヒ酸エチルヘキシル、イソノナン酸イソノニル、DPG、酸化チタン、グリセリン、ポリシリコーン-15、ジメチコン、ジエチルアミノヒドロキシベンゾイル安息香酸ヘキシル、ジメタクリル酸グリコールクロスポリマー、BG、ヒアルロン酸Na、加水分解ヒアルロン酸(ナノ化ヒアルロン酸)、アセチルヒアルロン酸Na(スーパーヒアルロン酸)、ビスエチルヘキシルオキシフェノールメトキシフェニルトリアジン、ポリソルベート60、PEG-32、PEG-6、ステアリン酸ソルビタン、(アクリレーツ/アクリル酸アルキル(C10-30))クロスポリマー、PEG-12ジメチコン、(アクリロイルジメチルタウリンアンモニウム/VP)コポリマー、シリカ、ステアリルアルコール、セタノール、アルミナ、ポリスチレン、ポリビニルアルコール、EDTA-2Na、TEA、酸化鉄、フェノキシエタノール、メチルパラベン<br><br>原産国<br><br>日本<br><br>お問い合わせ先<br><br>ロート製薬株式会社<br>大阪市生野区巽西1-8-1<br><br>お客様安心サポートデスク<br>東京：03-5442-6001<br>大阪：06-6758-1272<br>受付時間 9：00-18：00(土、日、祝日を除く)<br><br><br>（ロート製薬　ハダラボ　はだらぼ　hadarabo　日焼け止め　肌研　UVケア　UVジェル　紫外線対策　春　夏　パーフェクトゲル　極潤　ごくじゅん　潤い　スキンケア　オールインワン）<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
